import React from 'react'

const Checkout = ({user, address}) => {
    //user address for delivery. 
    //if no user address then notify user to update their profile for address.
    console.log(user)
    console.log(address)
    const {street_address, address_number, city, state, zip_code, country} = address.data

    return (
        //put this in a card
        <div className="global-mt">
            {street_address === null ? 
            <p>You currently don't have an address on file. Please update your address on your profile.</p> 
            : 
            <div class="card" style="width: 18rem;">
            <div class="card-body">
                <h5 class="card-title">Review your order</h5>
                <h6 class="card-subtitle mb-2 text-muted">Shipping Address</h6>
                <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
            </div>
            </div>
            }
        </div>
    )
}

export default Checkout
